function filterCars(subcategory, setCars) {
    fetch("http://localhost:3001/cars.json")
      .then((res) => res.json())
      .then((data) => {
        const jsonData = JSON.parse(data);
        if (Array.isArray(jsonData.cars)) {
          const result = jsonData.cars.filter((curData) => {
            return curData.seats === subcategory;
          });
          setCars(result);
        } else {
          console.error("Fetched data is not an array:", jsonData);
        }
      })
      .catch((error) => {
        console.error("Error fetching car.json:", error);
      });
  }

  export default filterCars;
